pragma solidity ^0.8.1;

import "./IClockAuction.sol";
import "./ClockAuctionBase.sol";

/// @title Clock auction for non-fungible tokens.
abstract contract ClockAuction is IClockAuction, ClockAuctionBase {
    /// @dev Constructor creates a reference to the NFT ownership contract
    ///      and verifies the contract owner cut is within the valid range
    /// @param _tokenContractAddress - address of a deployed contract implementing 
    ///      the ERC721 interface
    /// @param _ownerCut - percentage cut the contract owner takes on each auction, 
    ///      must be between 0-10,000 (basis points)
    constructor(address _tokenContractAddress, uint256 _ownerCut) {
        require(_ownerCut <= 10000, "Owner auction cut cannot exceed 100.00%");
        ownerCut = _ownerCut;
        
        IERC721 candidateContract = IERC721(_tokenContractAddress);
        require(
            candidateContract.supportsInterface(type(IERC721).interfaceId), 
            "Contract is not of type ERC721"
        );
        tokenContract = candidateContract;
    }

    /// @dev Starts a new auction
    /// @param _tokenId - ID of token to auction, sender must be its owner
    /// @param _startingPrice - Starting price (in wei) at beginning of auction
    /// @param _endingPrice - Final price (in wei) the auction can reach
    /// @param _duration - Length of time (in seconds) to move between the
    ///         starting price and the ending price
    /// @param _seller - The listed seller for the auction (the token owner
    ///         can set someone else as the seller/beneficiary)
    function createAuction(
        uint256 _tokenId,
        uint256 _startingPrice,
        uint256 _endingPrice,
        uint256 _duration,
        address payable _seller
    )
        public virtual override
        canBeStoredWith128Bits(_startingPrice)
        canBeStoredWith128Bits(_endingPrice)
        canBeStoredWith64Bits(_duration)
    {
        require(
            _senderOwnsToken(msg.sender, _tokenId), 
            "Token not owned by auction initiator"
        );

        _escrow(_seller, _tokenId);

        Auction memory _auction = Auction(
            _seller,
            uint128(_startingPrice),
            uint128(_endingPrice),
            uint64(_duration),
            uint64(block.timestamp)
        );

        _addAuction(_tokenId, _auction);
    }

    /// @dev Bids on an open auction, completing the auction and transferring
    ///      ownership of the NFT if enough Ether has been supplied
    /// @param _tokenId - ID of token to bid on
    function bid(uint256 _tokenId) public virtual payable override {
        // _bid will 'throw' if the bid or funds transfer fails
        _bid(_tokenId, msg.value);
        _transfer(msg.sender, _tokenId);
    }

    /// @dev Cancels an auction that hasn't been won yet
    ///     Returns the token to its original owner
    /// @param _tokenId - ID of token on auction
    function cancelAuction(uint256 _tokenId) public override {
        Auction storage auction = tokenIdToAuction[_tokenId];
        require(_isOnAuction(auction), "Token is not on auction");
        require(msg.sender == auction.seller, "Sender is not the auctioneer");

        _cancelAuction(_tokenId, auction.seller);
    }

    /// @dev Returns the data for an auction
    /// @param _tokenId - ID of the token being auction
    function getAuction(uint256 _tokenId) public view override returns (
        uint256 tokenId,
        address seller,
        uint256 startingPrice,
        uint256 endingPrice,
        uint256 duration,
        uint256 startedAt
    ) {
        Auction storage auction = tokenIdToAuction[_tokenId];
        require(_isOnAuction(auction), "Token is not on auction");

        return (
            _tokenId,
            auction.seller,
            auction.startingPrice,
            auction.endingPrice,
            auction.duration,
            auction.startedAt
        );
    }

    /// @dev Returns the current price of an auction
    /// @param _tokenId - ID of the token on auction
    function getCurrentPrice(uint256 _tokenId) public view override returns (uint256) {
        Auction storage auction = tokenIdToAuction[_tokenId];
        require(_isOnAuction(auction), "Token is not on auction");

        return _currentPrice(auction);
    }
}

